package dano_fra.entities;import java.time.LocalDate;import java.util.List;import java.util.Random;public class Order {    private final Long id;    private final String status;    private final LocalDate dateOrder;    private final LocalDate dateDelivery;    private final List<Product> products;    private final Customers customers;    Random random = new Random();    public Order(String status, LocalDate dateOrder, List<Product> products, Customers customers)  {        this.id = random.nextLong(1,1000000000);        this.status = status;        this.dateOrder = dateOrder;        this.products = products;        this.customers = customers;        this.dateDelivery = dateOrder.plusDays(5);    }    public List<Product> getProducts() {        return this.products;    }    @Override    public String toString() {        return "Order: " +"\n" +                "Status: " + status + "\n" +                "DateOrder: " + dateOrder + "\n" +                "DateDelivery: " + dateDelivery + "\n" +                "Products: " + products + "\n" +                "Customers: " + customers;    }    public Object getCustomerList() {        return null;    }}